import React from 'react'

const proxyUrl = "https://cors-anywhere.herokuapp.com/";
const url = "https://us-central1-project-share-8df06.cloudfunctions.net/api/";

const Fetching = () => {
    const fetching = () => {
        // Get Requests
        fetch(proxyUrl + url + 'getHome')
            .then(res => res.json())
            .then(data => console.log(data))
            .catch(() => console.log("Couldn't connect to " + url + " request. Check your browser"));
        
        // Post Requests and Headers
        fetch(proxyUrl + url + 'createPost', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
                'Authorization': 'Bearer eyJhbGciOiJSUzI1NiIsImtpZCI6IjFlNjYzOGY4NDlkODVhNWVkMGQ1M2NkNDI1MzE0Y2Q1MGYwYjY1YWUiLCJ0eXAiOiJKV1QifQ..LddYFaoGxELCy-lB_jzoj9SVqHI1u4frwP8TqsOjffwWBb_UZwpci5l7WwYuahNd-ZglB19BKt6oparYLWpHmBkOSJ90A1eneqFi8EgSsDA3oFsez0Ff7LvKpZlDAWUYvmX5MFX75bRp3PM-zhiEzVyB_toIeXSTvstdKniAYost5biYjBGTBPMsEJ1Aoe33lpPm_tWEO5qtkWhC-US2VZ2mDe74k5QJksWLfs1kxb9KkUWQByrK01Y8boUV4E61lwyMPSiSAlxYnFGQybJswm9Uz-OHVekhWUpViyqP1C47i6cjLZFfQfHQras-u5c5dE16_sVhwLpTiME4BZf-Rw'
            },
            body: JSON.stringify({
                "title": "padmini's Title",
                "body": "This is fetch's body",
                "category": "Brown Bois"
            }) 
        })
        .then(res => res.json())
        .then(data => {
            console.log(data);
        })
        .catch(err => {
            console.error(err);
        })
    };

    return (
        <div>
            { fetching() }
        </div>
    )
}

export default Fetching;
